export chunkMarkdown (FunctionDeclaration)

Snippet:
export function chunkMarkdown(raw: string): string[] {
  const paragraphs = raw
    .split(/\r?\n\r?\n+/)
    .map((p) => p.trim())
    .filter(Boolean);
  const chunks: string[] = [];
  let buf: string[] = [];
  let bufLen = 0;
  const flush = () => {
    if (bufLen > 0) {
      chunks.push(buf.join('\n\n'));
      buf = [];
      bufLen = 0;
    }
  };
  for (const para of paragraphs) {
    if (bufLen + para.length > MAX_CHUNK && bufLen >= MIN_CHUNK) {
      flush();
    }
    buf.push(para);
    bufLen += para.length;
    if (bufLen >= MAX_CHUNK) flush();
  }
  flush();
  return chunks;
}

