    startTask: (taskId: string) => orchestrator.startTask(taskId),
    completeTask: (taskId: string) => orchestrator.completeTask(taskId),
    failTask: (taskId: string, reason?: string) => orchestrator.failTask(taskId, reason),
  };
}

